import React from 'react'
import {BrowserRouter, Route} from 'react-router-dom'
import Splash from './components/Splash';


const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Route path='/' component={Splash}/>
      </div>
    </BrowserRouter>
  );
};
export default App;


